    // axios.post(`${process.env.REACT_APP_API}/task`) 



async function handelSubmit (e) {
        e.preventDefault();

        await axios.post(`${process.env.REACT_APP_API}/task` , {content:content})
        .then(res=>{
            setContent("")
        }) 
        .catch(error=>{
            alert(error)
        })

      }
  
return <div >

<Navbar/>





 <form onSubmit={handelSubmit}>
